import React from 'react';
import { Link } from 'react-router-dom';

function LandingPage() {
  return (
    <div style={{ textAlign: 'center', padding: '50px' }}>
      <img src="/logo.png" alt="Quiz Logo" style={{ height: '100px' }} />
      <h1>Welcome to Quiz App</h1>
      <div style={{ marginTop: '30px' }}>
        <Link to="/admin-login">
          <button style={{ margin: '10px', padding: '10px 20px' }}>Admin Login</button>
        </Link>
        <Link to="/user-login">
          <button style={{ margin: '10px', padding: '10px 20px' }}>User Login</button>
        </Link>
      </div>
    </div>
  );
}

export default LandingPage;
